import React from "react";
import Slider from "react-slick";
import image1 from "../assets/images/bg_1.jpg";
import image2 from "../assets/images/bg_2.jpg";
import image3 from "../assets/images/bg_3.jpg";

const Main = () => {
  const settings = {
    dots: true,
    arrows: false,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    speed: 2000,
    autoplaySpeed: 2000,
    cssEase: "linear"
  };
  return (
      <Slider className="home-slider" {...settings}>
        <div className="slider-item" style={{backgroundImage: `url(${image1})`}}>
          <h3>1</h3>
        </div>
        <div className="slider-item" style={{backgroundImage: `url(${image2})`}}>
          <h3>2</h3>
        </div>
        <div className="slider-item" style={{backgroundImage: `url(${image3})`}}>
          <h3>3</h3>
        </div>
      </Slider>
  );
}

export default Main;
